import './App.css';
import Form from "./components/Form"
import WriteCountry from './components/WriteCountry'
import {Link} from '@reach/router'


function App() {
  return (
    <div className="App">
      <header><Link to="/"><h1>Cities of the World</h1></Link></header>
      <Form />
      <WriteCountry />
    </div>
  );
}

export default App;
